import "./subNav.css"
import { NavLink } from "react-router-dom";
import useGlobalState from "../../Store_&_State/GlobalState"
import { useState, useEffect } from 'react';

import React from 'react';

const SubNav = () => {
  const {search, setSearch} = useGlobalState('');

  const subNav_selected_hover = (e) => {
    console.log(e)

    switch( e.target.firstChild.React.id) {
        case 'subNav_recurring_record':
          // code block
          break;
        case 'subNav_convert_to_pdf':
          // code block
          break;
        case 'subNav_graphs':
            // code block
            break;
        case 'subNav_ratios':
            // code block
            break;
        case 'subNav_filtter':
          // code block
          break;
        case y:
          // code block
          break;
        default:
          // code block
    }
    //   const subNav_selected = document.getElementsByClassName('subNav_icon_div').style.backgroundImage
